module.exports = function Xor(input, key) {
    var output = []
    var outputString = ""
    for(var i = 0; i < input.length; i++){
        output[i] = ("0b" + input[i].toString(2)) ^ key  
        if (i === 0) {
            outputString += output[i]
            continue;
        }
        outputString += "," + output[i]
    }
    return outputString;
}